import React, { Fragment } from 'react';
import { Button, Container, Header, Icon, Image } from 'semantic-ui-react';

import './Homepage.css';

export default function Homepage() {
  return (
    <Fragment>
      <Container text>
      <div className="intro-name">
      <Header>
      hello
      </Header>
      <p>My name is <strong>Hakeem Olakunle Isa Angulu</strong>. I was born and raised in Kingston, Jamaica, and I moved to the United States in 2014 to finish my education. In May 2020, I graduated from Harvard College with a Bachelor of Arts Bachelor of Arts degree in Computer Science and Statistics, with a secondary field of African American Studies.</p>
      <br/>
      I have two primary passions: art and code. This website aims to be a showcase of those two things, both separately and as one. I document here my own artwork (mostly photography) and my own coding projects, many of which have the explicit aim to amplify voices, facilitate justice and/or push limits.
      </div>
      </Container>
    </Fragment>
  )
}
